vanillajs_offcanvas={name:"vanillajs offcanvas",version:"5.2.2x1",init:function(){this.events()},events:function(){var e=this;document.getElementsByClassName("left-off-canvas-toggle")[0].onclick=function(t){obj=e.closest_wrap(t);e.click_toggle_class(obj,"move-right")};document.getElementsByClassName("right-off-canvas-toggle")[0].onclick=function(t){obj=e.closest_wrap(t);e.click_toggle_class(obj,"move-left")};document.getElementsByClassName("exit-off-canvas")[0].onclick=function(t){obj=e.closest_wrap(t);e.click_remove_class(obj,"move-right");e.click_remove_class(obj,"move-left")};console.log("events")},click_toggle_class:function(e,t){if(e!=null)e.classList.toggle(t)},click_remove_class:function(e,t){if(e!=null)e.classList.remove(t)},closest_wrap:function(e){e=e.target;class_name="off-canvas-wrap";while(e=e.parentNode){if(e.classList.contains(class_name)){return e}}return null}};vanillajs_offcanvas.init()
